import React from 'react'
import "./style.css"

const Restaurent = () => {
  return (
  
    <div className='card-container'>
         <div className='card'>
              <div className='card-body'>
                  <span className='card-number'>12</span>
              </div>
         </div>
    </div>
   
  );
};

export default Restaurent
